import { useState } from 'react';
import { Hall } from '../HallTypes';
import '../hall/Halls.css';

interface HallCardProps {
    hall: Hall;
    onDelete: (id: string) => void;
}

interface DailyInfo {
    date: string;
    feedConsumption: number;
    waterConsumption: number;
    mortality: number;
}

const HallCard: React.FC<HallCardProps> = ({ hall, onDelete }) => {
    const [showDetails, setShowDetails] = useState(false);
    const [showDailyInfo, setShowDailyInfo] = useState(false);
    const [dailyInfo, setDailyInfo] = useState<DailyInfo | null>(null);
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState<string | null>(null);

    const fetchDailyInfo = async (hallName: string) => {
        setLoading(true);
        setError(null);
        try {
            const response = await fetch(`/api/daily-info?hallName=${encodeURIComponent(hallName)}`);
            if (!response.ok) {
                throw new Error('Failed to fetch daily information');
            }
            const data = await response.json();
            setDailyInfo(data.info); // Assuming `data.info` contains the daily information in the expected structure
        } catch (err) {
            setError((err as Error).message);
        } finally {
            setLoading(false);
        }
    };

    const toggleDailyInfo = () => {
        if (!showDailyInfo) {
            fetchDailyInfo(hall.hallName);
        }
        setShowDailyInfo(!showDailyInfo);
    };

    return (
        <div className="hall-card">
            <div className="card-header" onClick={() => setShowDetails(!showDetails)}>
                <h3><strong>Hall Name:</strong> {hall.hallName}</h3>
                <span>{showDetails ? '▲ View Less' : '▼ View More'}</span>
            </div>

            {showDetails && (
                <div className="card-details">
                    <p><strong>Importer:</strong> {hall.importerName}</p>
                    <p><strong>Chickens:</strong> {hall.numberOfChickens.toLocaleString()}</p>
                    <p><strong>Initial Weight:</strong> {hall.initialWeight} kg</p>
                    <p><strong>Budget:</strong> {hall.budgetType}</p>
                    <p><small>Created: {new Date(hall.createdAt).toLocaleDateString()}</small></p>

                    <div className="card-actions">
                        <button 
                            className="edit-button" 
                            onClick={toggleDailyInfo}
                            disabled={loading}
                        >
                            {showDailyInfo ? 'Hide Daily Info' : loading ? 'Loading...' : 'Show Daily Info'}
                        </button>
                        <button 
                            className="delete-button" 
                            onClick={() => onDelete(hall.id)}
                        >
                            Delete
                        </button>
                    </div>

                    {showDailyInfo && (
                        <div className="daily-info">
                            {error ? (
                                <p className="error">{error}</p>
                            ) : dailyInfo ? (
                                <>
                                    <h4>Daily Information</h4>
                                    <p><strong>Date:</strong> {dailyInfo.date}</p>
                                    <p><strong>Feed Consumption:</strong> {dailyInfo.feedConsumption} kg</p>
                                    <p><strong>Water Consumption:</strong> {dailyInfo.waterConsumption} liters</p>
                                    <p><strong>Mortality:</strong> {dailyInfo.mortality}</p>
                                </>
                            ) : (
                                <p>No daily information available.</p>
                            )}
                        </div>
                    )}
                </div>
            )}
        </div>
    );
};

export default HallCard;
